import React from 'react'
import './App.css'
import script from './components/StarWars'

function App() {
  // Create object to place word-list in
  // Fetch data from source
  // Iterate over each word in list
  //    If word is new add word to object
  //    If word is repeated incremenet count for word
  // Print list of word bubbles in order of usage

  // MARK: Define text objects
  // TODO
  const words = {example: 1}
  let count = 0
  let newWord = ''

  for(const char of script) {
    // Saves me time
    count += 1
    if(count > 100) {break}

    // Add string to new word until space
    if(char !== " ") {
      newWord += char
    } else {
      console.log(newWord)
      newWord = ''
    }
  }

  // MARK: Get data
  // TODO

  // MARK: Iterate over words in list and place into new object
  for(const word of script) {
    if(word in words) {
      // Increment word count
      words.word.value += 1
    } else {
      // Add word to dictionary object
      Object.assign(word, {word: 1})
    }
  }

  for(const word in words) {
    console.log(word)
  }

  return (
    <h1>Hello world!</h1>
  )
}

export default App
